import React from 'react'
import classes from "../../ui/UI.module.css"
import siteData from "../../../context/siteData"
const Library = () => {

const album = siteData.map((album) => <h1>{album.albumName}</h1>);
    return (
        <div className={classes.section_view}>
            <ul>
                <li>{album}</li>
            </ul>
        </div>
    )
}

export default Library
